import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Redirect,
    Link
} from "react-router-dom";
ReactDOM.render(<Router>
    <Switch>
        <Redirect from="/" exact to="/videos/1af0jruup5gu" />
    </Switch>
</Router>, document.getElementById("root"));
